	ObjectCommand(context.Context, *Command) (*CommandResponse, error)
	RQL(context.Context, *Command) (*CommandResponse, error)
	GetObjectsValues(context.Context, *ObjectsValuesRequest) (*GetObjectValuesResponse, error)
